import math

def doubleAndFilterPrimes(nums):
    result = []
    for num in nums:
        if num > 0:
            doubled_num = num * 2
            is_prime = True
            if doubled_num <= 1:
                is_prime = False
            else:
                for i in range(2, int(math.sqrt(doubled_num)) + 1):
                    if doubled_num % i == 0:
                        is_prime = False
                        break
            if is_prime:
                result.append(doubled_num)
    return result

